import {menu} from '../menu';
import Menuitems from './Menuitems'

const Navbar = () => {
    return (
        <nav>
            <ul className='dropdown-content'>
                {menu.map((item, index) => {
                    return <Menuitems items={item} key={index} />
                })}
            </ul>
        </nav>
    );
};

export default Navbar;
